import React, { useState } from 'react'
import {Link} from 'react-router-dom';
import './NavBar.css'
import Logo from './../images/logo.png'
import Instagram from './../icons/instagram.png'
import LinkedIn from './../icons/linkedin.png'
import Gmail from './../icons/gmail.png'
import { BrowserRouter } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
function NavBar() {
  const [isClicked, setIsClicked] = useState(false);
  const [checked, setChecked] = React.useState(false);
  const navigate = useNavigate();
  return (
    <>
    <div className='navContainer'>
      <div className='navbar'>
        <div className='logo'>
          <Link onClick={()=>{
                navigate('/');
              }}>
            <img src={Logo} alt="Description of the image"></img>
          </Link>
        </div>
        <div className='navItems'>
          <ul>
            <li>
              <a onClick={()=>{
                navigate('/swayam-main');
              }}>
                Home
              </a>
            </li>
            <li>
              <a onClick={()=>{
                navigate('/swayam-main/about');
              }}
            >
                About
              </a>
            </li>
            <li>
              <a onClick={()=>{
                navigate('/swayam-main/blogs');
              }}>
                Blogs
              </a>
            </li>
            <li>
              <a onClick={()=>{
                navigate('/swayam-main/team');
              }}>
                Team
              </a>
            </li>
            <li>
              <a onClick={()=>{
                navigate('/swayam-main/events');
              }}>
                Events
              </a>
            </li>
            <li>
              <a onClick={()=>{
                navigate('/swayam-main/getinvolved');
              }}>
                Get Involved
              </a>
            </li>
            <li>
              <a onClick={()=>{
                navigate('/swayam-main/contact');
              }}>
                Contact
              </a>
            </li>
          </ul>
        </div>
      </div>
    </div>

    <div className="hamburgerMenu">
        <div className={isClicked ? "hamburgerMenuContent show": "hamburgerMenuContent"} id="hamburgerId">
            <ul>
                {/* <li><Link to='/'><img src={Logo}></img></Link></li>
                <li></li> */}
                <li id="1">
                  <a
                    onClick={() => {
                      setIsClicked(!isClicked);
                      setChecked(!checked);
                      navigate('/swayam-main');
                      }}
                    >HOME
                  </a>
                </li>
                <li id="2">
                  <a 
                  onClick={() => {
                    setIsClicked(!isClicked);
                    setChecked(!checked);
                    navigate('/swayam-main/about');
                  }}
                    >ABOUT
                  </a>
                </li>
                <li id="3">
                  <a 
                    onClick={() => {
                      setIsClicked(!isClicked);
                      setChecked(!checked);
                      navigate('/swayam-main/blogs');
                      }}>BLOGS

                  </a>
                </li>
                <li id="4">
                  <a to="/team" 
                    onClick={() => {
                      setIsClicked(!isClicked);
                      setChecked(!checked);
                      navigate('/swayam-main/team');
                      }}>TEAM
                  </a>
                </li>
                <li id="5">
                  <a 
                    onClick={() => {
                      setIsClicked(!isClicked);
                      setChecked(!checked);
                      navigate('/swayam-main/events');
                      }}>EVENTS
                  </a>
                </li>
                <li id="6">
                  <a 
                    onClick={() => {
                      setIsClicked(!isClicked);
                      setChecked(!checked);
                      navigate('/swayam-main/getinvolved');
                      }}>GET INVOLVED
                  </a>
                </li>
                <li id="7">
                  <a to="/contact" 
                    onClick={() => {
                      setIsClicked(!isClicked);
                      setChecked(!checked);

                      }}>CONTACT US
                  </a>
                </li>
            </ul>

            <div className="menuFooter">
                {/* <div className="leftLogo">
                  <img src={Logo} width="60px"></img>
                </div> */}
                <div className="rightSocials">
                  <a href='https://www.instagram.com/ecellvce/'  target="_blank" ><img src={Instagram} width="20px"></img></a>
                  <a href=' https://www.linkedin.com/company/swayam-e-cell/mycompany/' target="_blank" ><img src={LinkedIn} width="20px"></img></a>
                  <a href='https://mail.google.com/mail/u/0/?view=cm&fs=1&to=swayam@vce.ac.in&tf=1' target="_blank" ><img src={Gmail} width="25px"></img></a>
                </div>
            </div>
        </div>
        <div className="hamburgerMenuLine" id="hamMenuId">
            {/* <Link to="/">yes</Link> */}
            <input type="checkbox" checked={checked} className="toggler" 
            onClick={() => {
              setIsClicked(!isClicked);
              setChecked(!checked)
            }} 
            name="" id="toggle"></input>
            <div className="hamburger"></div>
        </div>

    </div>

    </>
  );
}

export default NavBar
